function Task3() {
    let name = "Mr. Svin";
    let job = "Professional Sunduchok player";

    return (
        <div id="task3">
            <img src="./images/svin.jpeg" alt="svin"/>
            <h3>{name}</h3>
            <p>{job}</p>
            <h4>Skills</h4>
        </div>
    );
}

export default Task3;
